import React from "react"
import '../style/header.css'

const Header = () =>{
    return (
        <div className="container">
            <ul className="navbar">
                <li className="nav-item active" ><a className="naw-link" href="#">My bowls</a></li>
                <li className="nav-item"><a className="nav-link" href="">Create</a></li>
            </ul>
            <form className="search">
                <input className="search-btn" id="search_btn" type="text" placeholder="Search">...</input>
                <button className="btn btn-search" id="search_btn">Search</button>
                <button className="btn btn-clear" id="search_clear">Clear</button>
            </form>
        </div>
    );
}

export default Header;
